return <Fragment>
<header className = {classes.header}>
<h1>Reactmeals</h1>
<CartButton/>
    </header>

  <div className =  {classes["main-image"]}>
  <img src={mealsImage}/>
  </div>

</Fragment>

};

export default Header;
